          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      */}
      <p>{count}</p>
      <UserCount.Provider value={[count, setCount]}>
        <Main />
      </UserCount.Provider>
      <button onClick={() => getData()}>
         data
      </button>
    </div>
  );
}

export default App;
